tables.table_schema:
CREATE TABLE StockPrices (
    stock_id INT,
    date DATE,
    open_price DECIMAL,
    close_price DECIMAL,
    high_price DECIMAL,
    low_price DECIMAL
);
CREATE TABLE TradingStrategies (
    strategy_id INT,
    strategy_name VARCHAR(50),
    description TEXT
);

CREATE TABLE stocks (
    symbol VARCHAR(10),
    price DECIMAL(10, 2),
    date DATE
);

CREATE TABLE stock_prices (
    symbol VARCHAR(10),
    price DECIMAL(10, 2),
    date DATE,
    volume INT
);

CREATE TABLE stock_trends (
    symbol VARCHAR(10),
    trend VARCHAR(50),
    trend_start_date DATE,
    trend_end_date DATE
);

CREATE TABLE stock_trends (
    trend_id SERIAL PRIMARY KEY,
    trend_description VARCHAR(255)
);

CREATE TABLE trading_strategies (
    strategy_id SERIAL PRIMARY KEY,
    strategy_name VARCHAR(255),
    strategy_description TEXT
);

CREATE TABLE trading_strategies (
    id INT PRIMARY KEY,
    strategy_name VARCHAR(50),
    strategy_description TEXT,
    strategy_type VARCHAR(50)
);

CREATE TABLE historical_data_sources (
    id INT PRIMARY KEY,
    source_name VARCHAR(50),
    data_format VARCHAR(50),
    data_url VARCHAR(255)
);

CREATE TABLE market_participants (
    id INT PRIMARY KEY,
    participant_name VARCHAR(50),
    participant_type VARCHAR(50),
    location VARCHAR(100)
);
